        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](56, " From January to April 2018, I explored mindfulness apps (mainly meditation apps) through the lenses of motivation theories (i.e. Self-determination theory) and positive computing. The primary research was supported by surveys, auto-ethnographic approaches and systematic reviews. This project was part of my MSc Human-Computer Interaction, Accessibility and Assistive Technologies module. ");
