        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](65, " Extensive research shows that mindfulness-based interventions can be highly effective when it comes to dealing with anxiety. Ubiquitous computing has made it possible for people seeking to overcome anxiety to easily access such interventions through their smartphone. However, some studies indicated that users tend to have inconsistent patterns of use and often lead to abandonment because of lack of motivation. In an era where positive computing emerges, it is important to address the motivational aspect of health interventions. In this study we take an auto-ethnographic approach to help inform evaluation of the motivation aspects applied in mindfulness apps through the lens of Self-Determination Theory. We thereby propose a set of design implications and future refinements. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
