        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](66, " From January to April 2018, I worked on a case study that focused on technological impact on affective needs in the context of long-distance relationships between international students and their families. This study consists of two parts: (1) a qualitative study, conducted as part of a team of six, and (2) an individual analysis of the findings and future directions of technology. This project was part of my MSc Human-Computer Interaction, Affective Interaction module. ");
