        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](75, " Affective Computing or Interaction aims to bridge the gap between human emotions and technologies. It has been demonstrated that ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](76, "a", 12);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](77, "emotion plays a critical role in our judgement and adaptive regulation of thought");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](78, ". In this article, \u201Caffective states\u201D, refers to moods and emotions as embodied reactions or pleasure or displeasure towards something. This is expressed over multiple systems of an organism. For example, not just having happy thoughts and feelings, but also expressing them in the face, body or actions. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
