        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](95, ". Our challenge was to empower a community of our choice through technology. We chose the London vegan community because the number of people who opt for a vegan lifestyle and diet had a 360% increase in the UK in the past decade, representing 22% of the UK population. Despite the rapid adoption, veganism is still a novel concept for many, and it is ridden with stigma, which can indimitate new adopters of this lifestyle. We found a gap in technology in supporting the London vegan community. Our goal was to design a product that would enrich, empower and sustain the vegan lifestyle in London. ");
