        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](103, "p");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](104, " As veganism in London expands, the need for a supportive network for vegan Londoners becomes increasingly vital. There are a few digital tools that help it achieve the level of exploration it requires and that are also compatible with their lifestyle choices. In this paper, we present Broccoli, a conceptual mobile application that connects its members through clear visibility to community-contributed content, such as social events, shops, restaurants, and announcements. Additionally we explore leveraging gamification by engaging the user via achievements and their avatar, and access community-reviewed information via tips and questions. Broccoli explores the advantages of augmented-reality (AR) to provide a real-world perception of the user\u2019s contribution and environmental impact. By working closely with 82 members of the London vegan community, we created a product that is superior due to fulfilling the need of a unified and dedicated platform for the community to express itself. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
