        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](50, "span", 9);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](51, "h1");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](52, "E-learning: Beyond the Graphical User Interface");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](53, "p", 10);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](54, "Research proposal for a mixed reality approach to E-learning");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](55, "p");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](56, " From January to April 2018, I worked on a research proposal that aims to cover a future interface topic or concept. My choice of focus was on how mixed reality might come into play to support the learning experience by exploring learning theories (i.e., social cognitive theory) and application of the mixed reality continuum. The proposal combines both qualitative and quantitative approaches. This project was part of my MSc Human-Computer Interaction, Future Interfaces module. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](57, "p");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](58, " This article summarises a University assignment paper. You can check ");
