        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](61, ". ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](62, "h2");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](63, "Abstract");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](64, "p");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](65, " Ubiquitous technology delivers education new possibilities, shifting from the two-dimensional environment to technology-enhanced simulations which permits students and teachers to go beyond the traditional didactic methods. In this paper we present an e-learning concept that leverages the power of mixed reality. By taking advantage of learning theories and mixed reality, we propose a system that aims to achieve seamless interaction in order to facilitate the learning outcomes, allowing the user to adapt the level of immersion to their needs. We further propose an evaluation plan which aims to assert whether enhancing e-learning with mixed reality is effective and achieves seamlessness. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](66, "h2");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](67, "Why is e-learning important?");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](68, "p");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](69, " As technology becomes ubiquitous, there has been a shift in higher education and pedagogy from traditional education practices towards more self-driven online education. E-learning is the concept and implementation of an online education approach, becoming well established and adapted by multiple educational systems, as modern technologies emerge. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](70, "p");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](71, " As an integral part of the educational system, e-learning is an effective tool as it offers flexibility through a wide range of opportunities within academic institutions and not only, for learners or academic qualification seekers to fulfil their educational objectives. On the opposite side, ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](72, "a", 12);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](73, "it provides teachers, instructors or professors with novel and flexible ways to teach their students");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](74, ". ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](75, "h2");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](76, "Graphical vs Tangible user interfaces");
