        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](90, "Weiser\u2019s vision of ubiquitous (or pervasive) computing was \"invisibility\"");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](91, ". They described the concept of seamless technology as a tool that does not intrude the user's consciousness, allowing them to focus solely on the task they perform, rather than on the technology they interact with. Technology such as AR, MR and VR sustain seamlessness, bridging the gap between the virtual and physical world. Their focus is to ");
